import { type } from "os";
import User from "../../models/userEntity";

type userResponse = {
  userName: string;
  password: string;
  fullName: string;
  emailAddress: string;
  contactNumber: string;
};

export type UserActions =
  | { type: "SET_CURRENT_USER"; payload: userResponse }
  | { type: "CLEAR_CURRENT_USER"; payload: null };
